import pic1 from "../images/kyochon1.png";
import pic2 from "../images/kyochon2.png";
import pic3 from "../images/kyochon3.png";

const GoodRestaurants = () => {
  return (
    <div>
      <img
        src={pic1}
        alt="pic"
        className="bg-auto border-[2px] h-[80px] w-[125px] bg-cyan-300  border-[#2D2D32] ml-[20px] bg-clip-border rounded-tl-lg"
      />
      <img
        src={pic2}
        alt="pic"
        className=" bg-auto h-[100px] w-[125px] bg-fuchsia-600 border-[2px] border-[#2D2D32] ml-[-2px] mt-[-200px] rounded-bl-lg"
      />

      <img
        src={pic3}
        alt="pic"
        className=" bg-auto h-[202px] w-[225px] bg-fuchsia-600 border-[2px] border-[#2D2D32] ml-[100px] mt-[20px] rounded-r-lg"
      />
    </div>
  );
};

export default GoodRestaurants;
